import React, { Fragment} from 'react';

import Header from '../components/header/Header';
import HeroSlider from '../components/hero-slider/HeroSlider';

const Home = () => {
    return(
    <Fragment>
        <Header />
        <HeroSlider />
    </Fragment>
    );
};

export default Home;
